import Card from "./Card";
import axios from 'axios'
import { useEffect, useState} from 'react';

function Home (){

    var data
    useEffect(()=>{
    axios({
        url:"http://localhost:5000/api/allassets",
        method:"get"

      }).then((response)=>{


        data=response.data

        console.log("...data",data)
      },(error)=>{
        console.log("...",error)
      })
   },[])

    return(
        <div>
            {data?.length>0 && data.map((each,index)=>{

      return(<Card data={each} key={index} />)
    })}
        </div>
    )
}
export default Home
